"""Given a list of math equations (given as strings), return the percentage of correct answers as a string. Round to the nearest whole 
number.

Examples

mark_maths(["2+2=4", "3+2=5", "10-3=3", "5+5=10"])) ➞ "75%"

mark_maths(["1-2=-2"])) #, "0%"

mark_maths(["2+3=5", "4+4=9", "3-1=2"])) ➞ "67%"

Note x:s

    You can expect only addition and subtraction.
    Note how there aren't any spaces in any given equation."""


def mark_maths(lst):
    lst = list(map(lambda x: x.split("="), lst))
    return str(round(sum(map(lambda x: eval(x[0]) == int(x[1]), lst)) / len(lst) * 100))+"%"
    
print(mark_maths(["2+2=4", "3+2=5", "10-3=3", "5+5=10"])) # ➞ "75%"
print(mark_maths(["1-2=-2"])) #, "0%"
print(mark_maths(["2+3=5", "4+4=9", "3-1=2"])) # ➞ "67%"

